import { useState } from "react";
import { useNavigate } from "react-router";
import {Typography } from '@mui/material';
import { Button } from '@mui/material';
import Modal from '@mui/material/Modal';
import Stack from '@mui/material/Stack';
import TextField from '@mui/material/TextField';
import Container from '@mui/material/Container';

import background from './assets/Jemeelah2-1.svg';

export const CreateAccount = () => {
 return (<div
    style = {{backgroundImage:`url(${background})`,
    height:'100vh',
    width:'100%',
    overflowX:'hidden',
    backgroundPosition:'center',
    backgroundSize:'cover',
        }}
        >
     <Container style ={{marginTop:10}}>
                <Typography variant="body1" color ='primary' style =  {{ fontSize:30}}>Create Account</Typography>
    </Container>
    <Container style ={{marginTop:30, marginBottom:20}}>
        <form>
            <Stack spacing ={2} style ={{width:'40%'}} >
                <TextField  variant= 'standard' label = 'First Name'  />
                <TextField  variant= 'standard' label = 'Last Name' />
                <TextField  variant= 'standard' label = 'Address' />
                <TextField  variant= 'standard' label = 'Phone Number' type = 'number' />
                <TextField  variant= 'standard' label = 'Email' type = 'email' />
                <TextField  variant= 'standard' label = 'Password' id="filled-password-input" type="password"  />
                <TextField  variant= 'standard' label = 'Create Password' id="filled-password-input" type="password"  />
                <TextField  variant= 'standard' label = 'Account Type' type = 'text' />
                <TextField  variant= 'standard' label = 'Pin' id="filled-password-input" type="password"  />
                <Button variant='contained' disableRipple color = 'primary'>Create Account</Button>
            </Stack>
        </form>
    </Container>
 </div>);
}
